import React from 'react';
import withData from '../../with-data';

const TestUserProfile = ({data, name, email}) => (
    <div className='container user-list'>
        <h1>{name}</h1>
        <h2>{email}</h2>
        Post: 
        <div>
            {data.map(post => 
                <div className='post'>
                    <h1>{post.title}</h1>
                    <p>{post.body}</p>
                </div>
                )}
        </div>
    </div>
)
export default withData(TestUserProfile, 'https://jsonplaceholder.typicode.com/posts')
